import Leaflet from 'leaflet';
import dron from './dron.png.png'

const LeafIcon = L.Icon.extend({
    options: {
        iconSize: [100, 100],
        iconAnchor: [50, 50],
        tooltipAnchor: [0, 0]
    }
});

export const dronIcon = new LeafIcon({ iconUrl: dron })
